import React from 'react';


const Medidas = () => {
    return ( 
        <div>
            <h2>Medidas</h2>
            <form>
                <div><span>Altura</span><span>x</span><span>Ancho</span></div>

                <label>1.20 X 1.20<input type="checkbox"  value="x"/></label><br/>

                <label>1.20 X 1.40<input type="checkbox"  value="x"/></label><br/>

                <label>1.20 X 1.20<input type="checkbox"  value="x"/></label><br/>

                <label>1.20 X 1.60<input type="checkbox" value="x"/></label><br/>

            </form>
        </div>
     );
}
 
export default Medidas;
